package test;

import medium.MinimumDeletionsToMakeCharacterFrequenciesUnique;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class MinimumDeletionsToMakeCharacterFrequenciesUniqueTest {

    @Test
    void minDeletions() {
        MinimumDeletionsToMakeCharacterFrequenciesUnique solution = new MinimumDeletionsToMakeCharacterFrequenciesUnique();
        int actual = solution.minDeletions("aab");
        int expected = 0;
        assertEquals(expected, actual);

        actual = solution.minDeletions("aaabbbcc");
        expected = 2;
        assertEquals(expected, actual);

        actual = solution.minDeletions("ceabaacb");
        expected = 2;
        assertEquals(expected, actual);

        actual = solution.minDeletions("");
        expected = 2;
        assertEquals(expected, actual);
    }
}